import ExpenseItem from "./Componets/ExpenseItem";
import Dolls from "./Componets/Dolls";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const dolls = [
    {
      name: "ken",
      price: 40,
      height: "6,1",
    },
    {
      name: "barbie",
      price: 100,
      height: "5,1",
    },
    {
      name: "joe",
      price: 30,
      height: "5'10",
    },
    {
      name: "sara",
      price: 70,
      height: "5,4",
    },
  ];

  return (
    <div>
      <h1>Jacobs react practice project</h1>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      />
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      />
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      />
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      />
      <div>
        <Dolls
          name={dolls[0].name}
          price={dolls[0].price}
          height={dolls[0].height}
        />
        <Dolls
          name={dolls[1].name}
          price={dolls[1].price}
          height={dolls[1].height}
        />
        <Dolls
          name={dolls[2].name}
          price={dolls[2].price}
          height={dolls[2].height}
        />
        <Dolls
          name={dolls[3].name}
          price={dolls[3].price}
          height={dolls[3].height}
        />
      </div>
    </div>
  );
}

export default App;
